import React from 'react';
import Header from './components/Header'
import OurCard from './components/Card'
import data from './components/data'
import { makeStyles } from '@material-ui/core/styles';
import Grid from '@material-ui/core/Grid';
import { BrowserRouter as Router, Route } from "react-router-dom";
import Login from './components/Signin'
import SignUp from './components/SignUp'
import FooterPage from './components/Footer'
import ForgotPass from './components/FrogotPassword'
import Mercedes from './components/Mercedes'
import './components/App.css'

const useStyles = makeStyles((theme) => ({
  paper: {
    height: 140,
    width: 100,
  },

}));

function App() {
  let ref =  React.createRef();
  count = ref.current.handleExpandClick()
  const classes = useStyles();
  return (
    <>
      <Router>
        <Header  />
        <Route path='/' exact >
          <Grid container justify="center">
            {data.map((value) => (
              <Grid key={value.id} item>
                <OurCard ref={ref} className={classes.paper} value={value} iconCount={0} />
              </Grid>
            ))}
          </Grid>
        </Route>
        {data.map((item) =>  (<Route exact path={'/' + item.name}>
     <Mercedes ndata={item.data} />
       </Route>
        ))}
        <Route path='/SignIn'>
          <Login />
        </Route>
        <Route path='/SignUp'>
          <SignUp />
        </Route>
        <Route path='/forgotPassword'>
          <ForgotPass />
        </Route>
      </Router>
      <FooterPage />
    </>

  );
}
export default App;
